loyd and the wave of protests in the wake of his death? Will you make an appearance at a Black Lives Matter event?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1208, \"fields\": {\"priority\": 6, \"description\": \"To what extent do you support emergency economic legislation to address the effects of COVID-19 on society?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1216, \"fields\": {\"priority\": 7, \"description\": \"What is your opinion on the expansion of mail-in voting and early voting in this election? Do you have any concerns?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1210, \"fields\": {\"priority\": 7, \"description\": \"What is your position on the need for a federal infrasctructure bill? How large should any package be?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1209, \"fields\": {\"priority\": 7, \"description\": \"As President, would you consider implementing policies such as a national lockdown or a mask mandate to control COVID-19?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1219, \"fields\": {\"priority\": 8, \"description\": \"Do you support the plans of some in your party to expand the size of the Supreme Court, in order to counteract the Republicans' actions in regard to Merrick Garland and Amy Coney Barret?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1218, \"fields\": {\"priority\": 8, \"description\": \"With the tragic passing of Ruth Bader-Ginsburg, it appears that Republicans are poised to place another conservative judge on the Supreme Court. What are your thoughts on their tactics?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1220, \"fields\": {\"priority\": 9, \"description\": \"Are you open to attending the customary three debates with your opponent, Mr. Trump?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1221, \"fields\": {\"priority\": 9, \"description\": \"What is your reaction to the news that President Trump has contracted COVID-19 and been hospitalized?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1213, \"fields\": {\"priority\": 10, \"description\": \"To what extent will you undo the draconian immigration and asylum policies that have been enacted under Trump?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1215, \"fields\": {\"priority\": 10, \"description\": \"Recent articles have discussed Donald Trump paying no federal income taxes in some previous years, or having a secret Chinese bank account. Is this something you want to emphasize?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1214, \"fields\": {\"priority\": 10, \"description\": \"Which gun control measures do you favor? Which ones do you oppose?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1217, \"fields\": {\"priority\": 10, \"description\": \"There has been an increase in Asian-American hate crimes in 2020, along with the rise of COVID and the inflammatory statements of Trump. What do you think about this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1211, \"fields\": {\"priority\": 10, \"description\": \"Do you support the recent truce with the Taliban in Afghanistan? What would your policy be in that country?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1212, \"fields\": {\"priority\": 10, \"description\": \"What are your views about the relationship wih China? Has Trump been too antagonistic on the trade issue?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1222, \"fields\": {\"priority\": -3, \"description\": \"President Trump has repeatedly dodged the question when asked whether he will accept the results of this year's election. Do you have any statements to make?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1223, \"fields\": {\"priority\": -2, \"description\": \"Right-wing websites have been circulating a story about a laptop that your son, Hunter, purportedly lost. Do you have any comment?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 1224, \"fields\": {\"priority\": -1, \"description\": \"Where do you want to concentrate your attention on during the final day of the campaign?\", \"likelihood\": 1.0}}]");
campaignTrail_temp.answers_json = JSON.parse("[{\"model\": \"campaign_trail.answer\", \"pk\": 6091, \"fields\": {\"question\": 1224, \"description\": \"We should put our focus into Georgia and North Carolina.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6000, \"fields\": {\"question\": 1200, \"description\": \"This election is a battle for the soul of America. If Donald Trump is President for four more years, the damage to this nation may be irreversible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6001, \"fields\": {\"question\": 1200, \"description\": \"We're going to build back better than ever before. I'm going to work for every American, repairing our critical infrastructure at home and our standing in the world.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6002, \"fields\": {\"question\": 1200, \"description\": \"I will be a President for all Americans. Black, brown, Latino, gay, straight, Christian, Jewish, Muslim, rich, poor, or middle-class. I'm a uniter, not a divider.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6003, \"fields\": {\"question\": 1200, \"description\": \"We have a President who turns his back on science, decency, and truth itself. A President who spends more time watching Fox News than he does doing his job. We need an adult in the White House.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6004, \"fields\": {\"question\": 1201, \"description\": \"We're going to defeat COVID and get America working again. I'm going to push for this day and night from the moment I step into the White House.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6005, \"fields\": {\"question\": 1201, \"description\": \"We need to build a country where all citizens are equal before the law and before their fellow man. We need to make sure people from all walks of life get the help they need to succeed.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6006, \"fields\": {\"question\": 1201, \"description\": \"I'm the trusted, steady leader that we need in a time of national crisis. I worked in the White House, actually worked, for eight years next to my great friend Barack Obama.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6007, \"fields\": {\"question\": 1201, \"description\": \"Donald Trump has assaulted our most vulnerable citizens, given away billions in tax breaks to the top 1 percent, alienated our allies, and utterly failed to address the COVID and policing crises. He must go.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6008, \"fields\": {\"question\": 1202, \"description\": \"I'm going to listen to our medical experts and stay at home to stop the spread. There are plenty of ways to get the message out on TV and in social media now. We're all in this together.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6009, \"fields\": {\"question\": 1202, \"description\": \"For the most part, I'm going to campaign from home until things settle down. But I do want to make a couple of public speeches (to limited crowds) on our most important issues.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6010, \"fields\": {\"question\": 1202, \"description\": \"I should be out there talking to the American people. That doesn't mean we do rallies with 10 thousand people, but we can't afford to just sit around in our basement for the next five months.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6011, \"fields\": {\"question\": 1203, \"description\": \"I'm prepared to give Senator Sanders some significant input into our platform and our campaign. He ran a very good race and said a lot that resonated with the American people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6012, \"fields\": {\"question\": 1203, \"description\": \"It's very important for our party to remain united and to put up a unified front against Donald Trump. And that's a two-way street, I'm sure we can both find some common ground and make a good show of unity.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6013, \"fields\": {\"question\": 1203, \"description\": \"We appreciate Senator Sanders and his support. But it's important to note that I won the nomination by a lot. I will be cordial but make few promises.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6014, \"fields\": {\"question\": 1203, \"description\": \"Who authorized this meeting? Did I authorize this meeting? We're telling Bernie Sanders that he'd better fall in line. We have an election to win.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6015, \"fields\": {\"question\": 1204, \"description\": \"The real crime here is what Donald Trump was doing, and we saw that with the impeachment proceedings. He shouldn't even be the President right now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6016, \"fields\": {\"question\": 1204, \"description\": \"There's absolutely no evidence that Hunter Biden did anything inappropriate in this case, the other side is putting forward debunked conspiracy theories to the contrary.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6017, \"fields\": {\"question\": 1204, \"description\": \"I'm proud of my son. He's overcome a lot to find success in life. This campaign is about the American people and their struggles and opportunities. I'm not going to spend my time talking about Trump and Ukrainie.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6018, \"fields\": {\"question\": 1204, \"description\": \"Hunter Biden is my son, but in this case his judgment was a little off. I'm prepared to fully apologize for any mixed signals this created.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6019, \"fields\": {\"question\": 1205, \"description\": \"Donald Trump flagrantly broke the law and he shouldn't be the President right now. Of course I'm going to bring that up.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6020, \"fields\": {\"question\": 1205, \"description\": \"I'm not going to spend the 2020 campaign focusing on 2019 issues. We need to talk about our plans to fight this COVID-19 epidemic and rebuild the economy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6021, \"fields\": {\"question\": 1205, \"description\": \"We might have our political differences, but I can't say whether I think this impeachment trial was justified or not. It's really a pretty gray area when you get down to it.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6022, \"fields\": {\"question\": 1206, \"description\": \"I'm proud to stand with Black Lives Matter in the wake of this incident. We need to fight the root causes of black poverty, defund the police, and fight for equity in our society and government.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6023, \"fields\": {\"question\": 1206, \"description\": \"This looks like an appalling misuse of police force, and incidents like this are the reason Black Lives Matter exists. I'm proud to do my small part to support the peaceful protests happening right now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6024, \"fields\": {\"question\": 1206, \"description\": \"Being a police officer is one of the hardest jobs there is, but they got it very wrong here. I have every confidence that Hennepin County will take the appropriate action against the officers involved in this case.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6025, \"fields\": {\"question\": 1206, \"description\": \"This case is no excuse for the rioting and disorder that we're seeing in many large cities, which in no way honors George Floyd. I condemn this situation unequivocally.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6030, \"fields\": {\"question\": 1208, \"description\": \"We need to put $2000 in the hands of every American, and we need to put forward a truly substantial relief package for our struggling small businesses and job creators.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6031, \"fields\": {\"question\": 1208, \"description\": \"We need to extend and expand unemployment insurance. We need a second round of stimulus payments like we had the first time. The economists are clear on this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6032, \"fields\": {\"question\": 1208, \"description\": \"If you look at what's happening right now with Trump and Mitch McConnell, they're holding up important legislation here. Hopefully everyone will come to their senses and it won't be an issue by next year.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6033, \"fields\": {\"question\": 1208, \"description\": \"I'm going to be taking a hard look at the economic conditions from my first day in office, and recommending the appropriate action from there.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6034, \"fields\": {\"question\": 1209, \"description\": \"One hundred percent. If we don't see the level of deaths and cases go down in this country, then we need to do whatever it takes to bring those into line.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6035, \"fields\": {\"question\": 1209, \"description\": \"If everyone would just wear a mask, the rate of transmission would drop by a lot, and we could all together beat this pandemic.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6036, \"fields\": {\"question\": 1209, \"description\": \"This shouldn't be a political decision that the President makes, it should be based on the science. The CDC is not recommending anything like a national lockdown right now, and I'm going to respect their expertise.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6037, \"fields\": {\"question\": 1209, \"description\": \"We're not going to have a national lockdown. That's just fear-mongering from the Republicans to distract from how they've mishandled the pandemic. This is something each locality can decide for themselves, based on local conditions.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6038, \"fields\": {\"question\": 1210, \"description\": \"I'm proposing a pretty big bill, you might have noticed, around $2 trillion to rebuild our roads, develop mass transit and green energy, and repair critical human infrastructure needs as well. We must move forward as a country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6039, \"fields\": {\"question\": 1210, \"description\": \"We're going to propose an infrastructure bill pretty soon after my inauguration, and it's going to be $500 billion or more. We're going to put people to work rebuilding our roads, bridges, ports, and power grid for the 21st century.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6040, \"fields\": {\"question\": 1210, \"description\": \"One of the first things we're going to do when I'm President is to make a full assessment of the nation's infrastructure and where we need to improve. And once we have that, then I can help us pass an informed and targeted infrastructure bill that addresses real priorities.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6041, \"fields\": {\"question\": 1210, \"description\": \"We need to worry about beating the COVID-19 pandemic and protecting the right of every American to have their voice heard at the ballot box. Those will be my first priorities.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6042, \"fields\": {\"question\": 1211, \"description\": \"We've tried to build Afghanistan into a stable, modern nation for nearly 20 years now, spending over $1 trillion in the process. It's time for their government to stand on its own, without American troops.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6043, \"fields\": {\"question\": 1211, \"description\": \"I'll make every effort to get us out of Afghanistan and end this war, but the way that Trump has gone about it has been completely backwards. His recent deal does nothing but embolden the Taliban in their attempts to take over.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6044, \"fields\": {\"question\": 1211, \"description\": \"We've got a small troop presence in Afghanistan right now, and we should probably keep it that way. I'm confident that country will continue to gradually stabilize over time, with a consistent but minimal investment from the United States.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6045, \"fields\": {\"question\": 1211, \"description\": \"It would be very unwise for us to pull back from Afghanistan at the present time. I'm going to meet with our generals and our national security establishment when I'm elected, and we're going to come up with a plan to give Afghanistan the support it needs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6046, \"fields\": {\"question\": 1212, \"description\": \"Trump's destructive trade war has set our relationship with China back 15 or 20 years, and that's ignoring the racist potshots he's taken at them over COVID. Our global economy depends on healthy trade and good relations between China and the outside world.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6047, \"fields\": {\"question\": 1212, \"description\": \"We have to be very realistic about how much cooperation is possible between the U.S. and China, but Trump's actions the past four years haven't helped. The last thing we need to be doing right now is inflaming the situation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6048, \"fields\": {\"question\": 1212, \"description\": \"Our relationship with China, depends on China. If they show a greater willingness to cooperate, then we can rebuild our relationship from the damage that Trump inflicted. If they continue to act in a hostile manner, we'll have to react accordingly.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6049, \"fields\": {\"question\": 1212, \"description\": \"With what we've seen recently in Hong Kong and Xinjiang, we can no longer afford to be na\\u00efve about where China is heading. I will aggressively continue our policy of pivoting to Asia to contain the rising influence of China.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6050, \"fields\": {\"question\": 1213, \"description\": \"One of the greatest human tragedies of the Trump Administration is the situation on the southern border. We will stop separating families, and we will do whatever it takes to reform our immigration processing in a sensible, humane manner.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6051, \"fields\": {\"question\": 1213, \"description\": \"We're going to undo some of these policies from day one, and I plan to make a strong push for an immigration reform bill that can help us deal with the backlog of asylum applications, and bring some of the undocumented out of the shadows.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6052, \"fields\": {\"question\": 1213, \"description\": \"Nobody can deny that the situation on the southern border is a problem right now, and one that we take very seriously. I'm going to do everything I can to resolve this issue when I'm President.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6053, \"fields\": {\"question\": 1213, \"description\": \"We're going to be fair, but we're going to be tough. I've always supported the rule of law in my career, for decades now, regardless of what some right-wing websites try to say about me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6054, \"fields\": {\"question\": 1214, \"description\": \"We need to look at whatever we can do right now to take guns off of the streets and reduce the level of shootings and murders in this country. I am going to push for any kind of assault weapons ban, background check, or other legislation that we can get.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6055, \"fields\": {\"question\": 1214, \"description\": \"If you look at these mass shootings we keep seeing, assault weapons are responsible for 90 percent of the problem. Everyone wants them banned except a small group of extremists and NRA lobbyists who have bought the Republican Party wholesale.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6090, \"fields\": {\"question\": 1224, \"description\": \"If we win Florida, this election is over. I want us doing events all over the state.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6056, \"fields\": {\"question\": 1214, \"description\": \"The right-wing media wants to present me as some kind of a gun-grabber, when that couldn't be further from the truth. My only crime is not parroting the NRA's every last word on this issue.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6057, \"fields\": {\"question\": 1215, \"description\": \"Come on, man! If there was ever a real investigation of Trump's tax practices by the IRS or the FBI, he'd probably be in prison right now. Am I wrong?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6058, \"fields\": {\"question\": 1215, \"description\": \"As part of a balanced campaign strategy, of course we're going to attack Donald Trump on his tax shenanigans. But we just need to make sure our main focus is on the substantive issues affecting working Americans.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6059, \"fields\": {\"question\": 1215, \"description\": \"People know all about Donald Trump and the dozens of scandals that have unfolded around him. I think we're better off talking about solutions to the COVID-19 crisis and the economy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6060, \"fields\": {\"question\": 1216, \"description\": \"It's a shame that it takes a global pandemic for us to get serious about the right to vote. The future of democracy demands that we protect the vote in this country, and I intend to push for federal legislation to do just that.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6061, \"fields\": {\"question\": 1216, \"description\": \"These are perfectly reasonable measures to take that will save lives in the midst of a global pandemic. It's a shame that Republicans, including Trump's Postal Service head, are willing to undermine this process so brazenly.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6062, \"fields\": {\"question\": 1216, \"description\": \"Anyone can see that we have special circumstances this year. If I'm elected, I plan to appoint a commission to research which of these measures were effective, and what we can do differently in 2024.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6063, \"fields\": {\"question\": 1216, \"description\": \"Two of my old friends, Jimmy Carter and James Baker, came out with a great study on election integrity a few years ago, and it's time we put their recommendations into action. I think this would represent a reasonable compromise between making it easy to vote, while ensuring our elections are secure from fraud.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6064, \"fields\": {\"question\": 1217, \"description\": \"Trump's willingness to inflame racial tensions and spread disinformation about China and coronavirus is appalling. There is a direct relationship between his actions and the increase in attacks that we've seen.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6065, \"fields\": {\"question\": 1217, \"description\": \"Asian-American hate needs to stop, right now. As a candidate I am pleading with all Americans to look into their hearts and ask what they can do to help on this important issue.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6066, \"fields\": {\"question\": 1217, \"description\": \"Reasonable, intelligent people should be able to distinguish between criticism of China, and criticism of Asian-Americans in the United States. It's very sad and unfortunate that some can't understand this, and we need to do everything possible to prevent these kinds of attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6067, \"fields\": {\"question\": 1217, \"description\": \"These attacks are wrong and they should prosecuted to the full extent of the law. At the same time, we need more answers from China. Millions of lives and trillions of dollars have been lost, yet they continue to block any serious investigation into the origins of this virus.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6068, \"fields\": {\"question\": 1218, \"description\": \"I'm warning Mitch McConnell right now. Either he can back off and wait until this election is over with to nominate a justice, or I will do everything in my power to expand the size of the Court as President.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6069, \"fields\": {\"question\": 1218, \"description\": \"This is a naked power grab by the Republicans, Trump, and Mitch McConnell that puts the integrity of the Court in serious jeopardy. It was just four years ago that McConnell took the exact opposite position on this same issue.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6070, \"fields\": {\"question\": 1218, \"description\": \"We can sit around all day worrying about tactics, but the fact of the matter is, we need to win elections. If Democrats did a better job of appealing to all Americans, we wouldn't be in this predicament right now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6071, \"fields\": {\"question\": 1219, \"description\": \"Absolutely. We can't sit here and play by the niceties of a bygone era while Republicans steamroll us. I'm prepared to appoint four new justices to the Supreme Court.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6072, \"fields\": {\"question\": 1219, \"description\": \"Fair is fair, right? The Republicans have stolen two seats on the Court with McConnell's chicanery. I think we should create two new justices and appoint them in return.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6073, \"fields\": {\"question\": 1219, \"description\": \"This is a very serious issue and the integrity of the Court is at risk. We're going to create a commission when I'm elected to recommend ways in which we can reform the federal court system and restore the faith of the American people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6074, \"fields\": {\"question\": 1219, \"description\": \"The Court has had nine justices since 1869, and any attempt to change that is sure to destroy the Court's legitimacy even further. We must look at other kinds of reform.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6075, \"fields\": {\"question\": 1220, \"description\": \"We're in the midst of a COVID pandemic and Trump has refused to accept the legitimacy of this year's results. I think it's best if we buy a 30-minute TV slot and take my case directly to the American people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6076, \"fields\": {\"question\": 1220, \"description\": \"I've been around politics long enough to know that you <i>always</i> show up to the debates when you're a challenger\\u2026 even against Trump and even in 2020.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6077, \"fields\": {\"question\": 1220, \"description\": \"I've been around politics long enough to know that you <i>always</i> show up to the debates when you're a challenger\\u2026 even against Trump and even in 2020.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6078, \"fields\": {\"question\": 1220, \"description\": \"I've been around politics long enough to know that you <i>always</i> show up to the debates when you're a challenger\\u2026 even against Trump and even in 2020.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6079, \"fields\": {\"question\": 1221, \"description\": \"From day one, Trump has failed to take this pandemic seriously, and has actively encouraged behaviors that spread COVID-19. What we see now is the natural consequence of that recklessness, and it only shows how unfit he is to be President of the United States.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6080, \"fields\": {\"question\": 1221, \"description\": \"We are praying for a full recovery, but we've seen time after time how Trump has disregarded the medical advice on masking and social distancing.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6081, \"fields\": {\"question\": 1221, \"description\": \"Jill and I are praying for a full and speedy recovery for President Trump. As someone who has dealt with tragedy, you never want to see this kind of thing happen to anyone.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6082, \"fields\": {\"question\": 1222, \"description\": \"With minority voter suppression, Russian interference, social media misinformation, and the Postal Service's sabotage of mail-in voting, I don't know why Trump should be the one to doubt the integrity of this year's election. It's Democrats who should be worried!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6083, \"fields\": {\"question\": 1222, \"description\": \"I've walked the walk on this issue. As Vice President, I was the one who personally certified Donald Trump's election in January of 2017. Trump's rhetoric is extremely irresponsible and dangerous to the future of democracy in this country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6084, \"fields\": {\"question\": 1222, \"description\": \"If Trump thought he was going to win this election, he wouldn't be saying these kinds of things. I'm confident that we're going to win, and that the American people will have full faith in the outcome this year.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6085, \"fields\": {\"question\": 1222, \"description\": \"Let's just wait and see how this all plays out before we go throwing wild accusations at each other. I have every confidence that this will be a fair election.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6086, \"fields\": {\"question\": 1223, \"description\": \"This is a fake laptop. End of story. I don't know how it got passed around, but you have to strongly suspect Russian intelligence or other nefarious actors here.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6087, \"fields\": {\"question\": 1223, \"description\": \"This story is disinformation, nothing is proven about the laptop, and no reputable news agency will run with this story. Why should I insert myself into the middle of this controversy?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6088, \"fields\": {\"question\": 1224, \"description\": \"I want us to focus on Pennsylvania, with maybe a quick stop over the border in Ohio.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6089, \"fields\": {\"question\": 1224, \"description\": \"We're going to campaign hard in Michigan, Wisconsin, and Iowa on this final day of the campaign.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6096, \"fields\": {\"question\": 1227, \"description\": \"I talked with a lot of people before I made my decision, and Karen Bass stood out as someone with the judgment and experience to work with me in the White House.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 6097, \"fields\": {\"question\": 1227, \"description\": \"We need a ticket that can appeal to all of our wonderful supporters. Karen Bass will fight tirelessly for better health care, infrastructure, higher wages, and racial equity. I couldn't be more proud to announce her as my running mate.\"}}]");

ck\": \"Your line, \\u201che shouldn't even be President right now\\u201d, gets replayed on cable news and clearly sets the tone for your thinking on this issue.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3018, \"fields\": {\"answer\": 6017, \"candidate\": 300, \"answer_feedback\": \"Impeachment was a very polarizing issue, and maybe it is best to just move on to other things.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3019, \"fields\": {\"answer\": 6018, \"candidate\": 300, \"answer_feedback\": \"It's an age old question -- does apologizing help to clear the air around a certain issue, or does it just make you look weak?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3020, \"fields\": {\"answer\": 6019, \"candidate\": 300, \"answer_feedback\": \"Your strong stance on Trump's impeachment is keeping the issue in the news throughout this campaign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3021, \"fields\": {\"answer\": 6021, \"candidate\": 300, \"answer_feedback\": \"Some of your core Democratic voters are worried and confused by your equivocal tone on impeachment, given how obviously guilty they believe Trump to have been.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3022, \"fields\": {\"answer\": 6022, \"candidate\": 300, \"answer_feedback\": \"Your willingness to use \\u201cdefund the police\\u201d rhetoric establishes you as a firm supporter of Black Lives Matter -- and opens you up to heated attacks from the right.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3023, \"fields\": {\"answer\": 6024, \"candidate\": 300, \"answer_feedback\": \"Some allies hoped to see a bit of a stronger statement from you on this issue.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3024, \"fields\": {\"answer\": 6025, \"candidate\": 300, \"answer_feedback\": \"Many progressives believe that you are trying way too hard to win over independent support in this election, even to the extent of flirting with racist rhetoric to do so.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3025, \"fields\": {\"answer\": 6030, \"candidate\": 300, \"answer_feedback\": \"People note that you are vigorously pushing for more economic stimulus and relief payments.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3026, \"fields\": {\"answer\": 6032, \"candidate\": 300, \"answer_feedback\": \"Some people on both sides of the spectrum note that you are trying to finesse this issue.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3027, \"fields\": {\"answer\": 6033, \"candidate\": 300, \"answer_feedback\": \"Some people on both sides of the spectrum note that you are trying to finesse this issue.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3028, \"fields\": {\"answer\": 6034, \"candidate\": 300, \"answer_feedback\": \"Within minutes, headlines of \\u201cLockdown Joe\\u201d are flooding right-wing news sites. You are definitely putting yourself front and center on this issue.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3029, \"fields\": {\"answer\": 6036, \"candidate\": 300, \"answer_feedback\": \"Perhaps it is best to defer on this issue for now, and point to the agencies in charge of such a decision.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3030, \"fields\": {\"answer\": 6037, \"candidate\": 300, \"answer_feedback\": \"You're successfully striking a moderate tone, but many of core supporters want a stronger stance on COVID prevention.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3032, \"fields\": {\"answer\": 6039, \"candidate\": 300, \"answer_feedback\": \"A $500 billion bill used to be a big deal in Washington, but maybe not so much these days.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 3033, \"fields\": {\"answer\": 6040, \"candidate\": 300, \"answer_feedback\": \"Infrastructure spending is farily popular across the spectrum. It
